import { Container, Row, Col } from "react-bootstrap";
import { MailchimpForm } from "./MailchimpForm";
// import logo from "../assets/img/logo.svg";
import navIcon1 from "../assets/img/nav-icon1.svg";
// import navIcon2 from "../assets/img/nav-icon2.svg";
// import navIcon3 from "../assets/img/nav-icon3.svg";
import git from "../assets/img/git.png";
import leetcode from "../assets/img/leetcode.png";

export const Footer = () => {
  return (
    <footer className="footer">
      <Container>
        <Row className="align-items-center">
          <MailchimpForm />
          {/* <Col size={12} sm={6}> */}
            {/* <img src={logo} alt="Logo" /> */}
          {/* </Col> */}
          <Col size={12} sm={6} className="text-center text-sm-end">

            <div className="social-icon">
              <a href="https://www.linkedin.com/in/rahul-kumar-yadav-1143a41a5/"><img src={navIcon1} alt="Icon" /></a>
              <a href="https://github.com/RahulKrYadav?tab=repositories"><img src={git} alt="Icon" /></a>
              <a href="https://leetcode.com/rahulyadav3/"><img src={leetcode} alt="Icon" /></a>
            </div>

            <p>Copyright 2023. All Rights Reserved</p>

          </Col>
        </Row>
      </Container>
    </footer>
  )
}
